from typing import List
from collections import defaultdict, Counter


class Solution:
    def largestValsFromLabels(self, values: List[int], labels: List[int], num_wanted: int, use_limit: int) -> int:
        mapped = list(zip(values, labels))
        mapped.sort(reverse=True)

        label_used = defaultdict(int)
        wanted, res = 0, 0
        for k, v in mapped:
            if label_used[v] < use_limit and wanted < num_wanted:
                res += k
                label_used[v] += 1
                wanted += 1
            elif wanted == num_wanted:
                break
        print(res)
        return res


    def largestValsFromLabels2(self, values: List[int], labels: List[int], num_wanted: int, use_limit: int) -> int:
        mapped = list(zip(labels, values))
        dct = defaultdict(list)
        used_cnt = Counter()
        idx_cnt = dict()
        for k, v in mapped:
            dct[k].append(v)
            used_cnt[k] = 0
        for k, v in dct.items():
            v.sort(reverse=True)
            idx_cnt[k] = len(v)

        wanted, total = 0, 0
        while wanted < num_wanted:
            max_vals = [v[0] for k, v in dct.items() if used_cnt[k] < use_limit and idx_cnt[k] > 0]
            if len(max_vals) == 0:
                break
            maxv = max(max_vals)
            for k, v in dct.items():
                if used_cnt[k] < use_limit and idx_cnt[k] > 0 and maxv == v[0]:
                    # print(k, v, maxv)
                    total += maxv
                    v.pop(0)
                    used_cnt[k] += 1
                    idx_cnt[k] -= 1
                    break
            wanted += 1
        print(total)
        return total


